script: |
  super -f text -I q6160.spq | sort > q6160.out

inputs:
  - name: q6160.spq
    data: |
      SELECT DISTINCT cor1.col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q6160.out
    data: |
      3
      64
      80
